import React from 'react';
import { Progress, Card, Row, Col } from 'antd';
import '../../styles/Dashboard.css'; // Import your styles here

const Dashboard = () => {
  return (
    <div className="dashboard">
      {/* Energy Summary Section */}
      <Row gutter={16} className="energy-summary">
        <Col span={12}>
          <Card className="energy-card" bordered={false}>
            <Progress
              type="circle"
              percent={50}
              strokeColor="#5E5CE6"
              format={() => '938 Kcal'}
              width={80}
            />
            <p>Calorie consumed</p>
          </Card>
        </Col>
        <Col span={12}>
          <Card className="energy-card" bordered={false}>
            <Progress
              type="circle"
              percent={50}
              strokeColor="#5E5CE6"
              format={() => '938 Kcal'}
              width={80}
            />
            <p>Calorie remaining</p>
          </Card>
        </Col>
      </Row>

      {/* Macro Targets Section */}
      <Row gutter={16} className="macro-targets">
        <Col span={8}>
          <Card className="macro-card" bordered={false}>
            <Progress
              type="circle"
              percent={75}
              strokeColor="#5E5CE6"
              format={() => '345/453 (g)'}
              width={70}
            />
            <p>Protein</p>
          </Card>
        </Col>
        <Col span={8}>
          <Card className="macro-card" bordered={false}>
            <Progress
              type="circle"
              percent={75}
              strokeColor="#5E5CE6"
              format={() => '345/453 (g)'}
              width={70}
            />
            <p>Net Carb</p>
          </Card>
        </Col>
        <Col span={8}>
          <Card className="macro-card" bordered={false}>
            <Progress
              type="circle"
              percent={75}
              strokeColor="#5E5CE6"
              format={() => '345/453 (g)'}
              width={70}
            />
            <p>Fat</p>
          </Card>
        </Col>
      </Row>
    </div>
  );
};

export default Dashboard;
